import React from 'react';
import './Msg.css';
import { TweenMax, Power1 } from 'gsap';
import Media from 'react-media';

// Return Msg Compoent view
export default function ReturnMsg() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 )
};


export const ScreenLarge = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-msg-register', .5, { delay: 1, opacity: 0, y: 20, ease: Power1.ease });
 });

 return (
  <div className='wrp-msg-register'><ViewText /></div>
 );
};
export const ScreenSmall = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-msg-register-sm', .5, { delay: 1, opacity: 0, y: 20, ease: Power1.ease });
 });

 return (
  <div className='wrp-msg-register-sm'><ViewText /></div>
 )
}
export const ViewText = () => {
 return (
  <p>Enregistre avec success</p>
 );
}
